import { makeStyles } from "@mui/styles"


export const useStyles = makeStyles({
  logo:{
    color:"black",
  },
  headerBar:{
    textAlign:'left',
    backgroundColor:'white !important',
    boxShadow:'none',
  },
  itemMenu:{
    color:'black',
    marginLeft:'20px !important'
  },
  menu:{
    display:'flex',
    marginLeft:'20px',
    flexGrow:"1",
    alignItems:'self-start'
  }
})
